		if ($script:DeselectedIndex -ne -1 -and $script:DeselectedIndex -lt $_.TabPageIndex)
		{
			#Validate each page until we reach the one we want
			for ($index = $script:DeselectedIndex; $index -lt $_.TabPageIndex; $index++)
