			function Set-Recovery
			{
				param
				(
					[string][Parameter(Mandatory = $true)]
					$ServiceDisplayName,
					[string][Parameter(Mandatory = $true)]
					$Server,
					[string]$action1 = "restart",
					[int]$time1 = 30000,
					# in miliseconds
	
					[string]$action2 = "restart",
					[int]$time2 = 30000,
					# in miliseconds
	
