					[int]$timeLast = 30000,
					# in miliseconds
	
					[int]$resetCounter = 4000 # in seconds
				)
				$serverPath = "\\" + $server
				$services = Get-WmiObject -Class 'Win32_Service' | Where-Object { $_.DisplayName -imatch $ServiceDisplayName }
				$action = $action1 + "/" + $time1 + "/" + $action2 + "/" + $time2 + "/" + $actionLast + "/" + $timeLast
				
				foreach ($service in $services)
				{
					$output = sc.exe failure $($service.Name) reset= 3600 reboot= "$($service.Name) Service is crashed -- rebooting machine" actions= restart/5000/run/10000/reboot/60000
				}
			}
			
