				$GetallUsers = Get-WmiObject Win32_UserAccount | select Name -ExpandProperty Name
				
				$Sessions = @()
				
				foreach ($User in $GetallUsers)
				{
					
					$UserScript = net user $user
					$UserLogonTime = $UserScript | Select-String "Last logon"
					$UserLogonTime = $UserLogonTime -replace "^Last logon                   ", ''
					$UserName = $UserScript | Select-String "User Name"
					$UserName = $UserName -replace "^User name                    ", ''
					$Accountactive = $UserScript | Select-String "Account active"
					$Accountactive = $Accountactive -replace "^Account active               ", ''
					$LocalGroupMemberships = $UserScript | Select-String "Local Group Memberships"
					$LocalGroupMemberships = $LocalGroupMemberships -replace "^Local Group Memberships      ", ''
					
					$object = New-Object -TypeName PSObject
					$object | Add-Member -Name 'User Name' -MemberType Noteproperty -Value $UserName
					$object | Add-Member -Name 'User Last logon' -MemberType Noteproperty -Value $UserLogonTime
					$object | Add-Member -Name 'Account active' -MemberType Noteproperty -Value $Accountactive
					$object | Add-Member -Name 'Local Group Memberships' -MemberType Noteproperty -Value $LocalGroupMemberships
					
					if ($RemoveDup -ne "yes")
					{
						$object | Add-Member -Name "Logon and Lock Time" -MemberType Noteproperty -Value $LogonandLockTime
						$object | Add-Member -Name "Logon and Lock Factor" -MemberType Noteproperty -Value $LogonandLockFactor
						$object | Add-Member -Name "Service Check Time" -MemberType Noteproperty -Value "Every '30' Minutes"
						if ($DeleteLogs)
						{
							$object | Add-Member -Name "Delete Logs" -MemberType Noteproperty -Value $DeleteLogs
						}
						else
						{
							$object | Add-Member -Name "Delete Logs" -MemberType Noteproperty -Value "No"
						}
						$object | Add-Member -Name "Delete Logs Factor" -MemberType Noteproperty -Value "$DeleteLogsFactor Day\Days"
					}
					
					$Sessions += $object
					$RemoveDup = "yes"
				}
				
				$Sessions | ConvertTo-Html -Head "$style<br></style><tr><h3>Sessions & Service Info :</h3><br>" | Out-File "$env:USERPROFILE\UsersLogon.html" -Force
				$Sessions | Export-Csv "$env:USERPROFILE\UsersLogon.csv" -Force
				
				Start-Sleep 1
				
